import React from 'react';

const Body = () => {
  return (
    <div className='flex flex-col pt-8 pl-20 pr-20 laptop:pl-0 laptop:pl-4'>
      <h1 className='flex justify-center text-5xl font-bold font-serif'>Lukas Arnroth</h1>
      <h1 className='text-l mt-5'>
        I am a PhD-candidate at the department of Statistics, Uppsala University. My research
        focuses on the exponential power class
      </h1>
      <h1 className='text-3xl mt-5'>Peer-reviewed publications</h1>
      <h1 className='text-3xl mt-5'>Work in progress</h1>
      <h1 className='text-3xl mt-5'>Software</h1>
    </div>
  );
};

export default Body;
